import { Button, Card } from "react-bootstrap";
function FeedBack() {
  return (
    <>
    <div>
      <Card style={{ width: '18rem',backgroundColor:"hsl(213, 19%, 18%)" }}>
        <Card.Body>
          <img alt="star" src="icon-star.svg"/>
          <Card.Title className="pt-3" style={{color:"hsl(0, 0%, 100%)" , fontFamily:"overpass"}}>How did we do ? </Card.Title>
          <Card.Text  style={{color:"hsl(216, 12%, 54%)", fontFamily:"overpass", fontSize:"15px"}}>
            Please let us know how we did with your support request. All feedback is appreciated to help us improve our offering !
          </Card.Text>
          <button className="rounded-circle" >1</button>
          <Button style={{backgroundColor:"hsl(25, 97%, 53%)",width:"240px"}} className="rounded-pill">SUBMIT</Button>
        </Card.Body>
      </Card>
    </div>
   
    </>
  );
}

export default FeedBack;
